import React from "react";

const Pagination = (props) => {
  let next = () => {
    props.onClick();
  };
  let prev = () => {};
  return (
    <div className="container">
      <button onClick={prev} className="btn btn-primary">
        Prev
      </button>
      <button onClick={next} className="btn btn-primary">
        Next
      </button>
    </div>
  );
};

export default Pagination;
